import {makeStyles,TableContainer, Table, TableBody,Button, TableCell, TableHead, TableRow, Paper, IconButton, Tooltip } from "@material-ui/core"
import { blueGrey } from '@material-ui/core/colors';
import VisibilityIcon from '@material-ui/icons/Visibility';
import 'primeicons/primeicons.css';
import DeleteForeverIcon from '@material-ui/icons/DeleteForever';
import { Link } from "react-router-dom";
import axios from "axios";
import './list.css';
import XLSX from 'xlsx';
import { useState, useEffect ,useRef} from "react";



const useStyles = makeStyles({
 stuListColor: {
  backgroundColor: blueGrey[900],
  color: "white"
 },
 tableHeadCell: {
  color: "white",
  fontWeight: "bold",
  fontSize: 16
 },
})

const List = () => {
  const tableRef = useRef(null);
 const classes = useStyles();
 const [students, setStudents] = useState([]);


 const exportToExcel = () => {
      const table = tableRef.current;
  const workbook = XLSX.utils.book_new();
  const sheet = XLSX.utils.table_to_sheet(table);

  // Ajustar el ancho de las columnas para que se ajuste al contenido
  const columnWidths = Object.keys(sheet).reduce((widths, cell) => {
    const columnName = cell.replace(/[^A-Z]/g, '');
    const columnWidth = sheet[columnName].wch || 10;
    widths[columnName] = Math.max(widths[columnName] || 0, columnWidth);
    return widths;
  }, {});
  sheet['!cols'] = Object.keys(columnWidths).map(column => ({ wch: columnWidths[column] }));

  const worksheet = XLSX.utils.sheet_add_aoa(sheet);
  XLSX.utils.book_append_sheet(
    workbook,
    sheet,
    'Lista de usuarios'
  );

  XLSX.writeFile(workbook, 'Lista de usuarios.xlsx');


  };





 useEffect(() => {
  async function getAllStudent() {
   try {
    const students = await axios.get("http://localhost:3333/students")
    // console.log(students.data);
    setStudents(students.data);
   } catch (error) {
    console.log("Something is Wrong");
   }
  }
  getAllStudent();
 }, [setStudents])

 const handleDelete = async id => {
  await axios.delete(`http://localhost:3333/students/${id}`);
  var newstudent = students.filter((item) => {
   // console.log(item);
   return item.id !== id;
  })
  setStudents(newstudent);
 }


 return (
  <>


   <TableContainer class="table_con" style={{marginLeft: '10px',marginTop: '30px'}} component={Paper}>                     
   <Table ref={tableRef} > 
     <TableHead>
      <TableRow >  
       <TableCell style={{ backgroundColor: 'white', color: 'black',border: '4px solid black'}} align="center" className={classes.tableHeadCell}>ID</TableCell>
       <TableCell style={{ backgroundColor: 'white', color: 'black',border: '4px solid black'}} align="center" className={classes.tableHeadCell}>Nombre</TableCell>
       <TableCell style={{ backgroundColor: 'white', color: 'black',border: '4px solid black'}} align="center" className={classes.tableHeadCell}>Gmail</TableCell>
       <TableCell style={{ backgroundColor: 'white', color: 'black',border: '4px solid black'}} align="center" className={classes.tableHeadCell}></TableCell>
      </TableRow>
     </TableHead>
     <TableBody>

       {
          students.map((student, i) => {


        return (


          <TableRow style={{ backgroundColor: "#f0efd8" }} key={i}>

          <TableCell style={{ backgroundColor: 'grey', color: 'black',border: '4px solid black'}} align="center">{i + 1}</TableCell>
          <TableCell style={{ backgroundColor: 'grey', color: 'black',border: '4px solid black'}} align="center">{student.stuname}</TableCell>
          <TableCell style={{ backgroundColor: 'grey', color: 'black',border: '4px solid black'}} align="center">{student.email}</TableCell>
          <TableCell style={{ backgroundColor: 'grey', color: 'black',border: '4px solid black'}} align="center">
           <Tooltip title="ver registro">
            <IconButton><Link to={`/view/${student.id}`}><VisibilityIcon color="primary" /></Link></IconButton>
           </Tooltip>
           <Tooltip  title="Editar">
            <IconButton><Link className="pi pi-user-edit" style={{ fontSize: '1.5rem', color: 'blue' }} to={`/edit/${student.id}`}></Link></IconButton>
           </Tooltip>
           <Tooltip title="Eliminar">
            <IconButton onClick={() => handleDelete(student.id)}><DeleteForeverIcon color="secondary" /></IconButton>
           </Tooltip>


            </TableCell>
            </TableRow>

        )

       })
      }

   </TableBody>
    </Table>
   </TableContainer>
   <Button onClick={exportToExcel}>Exportar a Excel</Button>

  </>
 )

}

export default List
